import React from 'react';
import Note from './Note';

const NoteList = ({ notes, onNoteClick, onDelete }) => {
  return (
    <div>
      {notes.map((note) => (
        <Note key={note.id} note={note} onClick={onNoteClick} onDelete={onDelete} />
      ))}
    </div>
  );
};

export default NoteList;
